/* eslint no-unused-vars: 0 */
import { html, svg, repeat, classMap, styleMap, ifDefined, unsafeHTML, scopeTag } from "@ui5/webcomponents-base/dist/renderer/LitRenderer.js";
import type UI5Element from "@ui5/webcomponents-base/dist/UI5Element.js";
import type FormItem from "../../FormItem.js";
import type { ClassMapValue } from "@ui5/webcomponents-base/dist/types.js";

function block0 (this: FormItem, context: UI5Element, tags: string[], suffix: string | undefined) { return html`<div class="ui5-form-item-root"><div class="ui5-form-item-layout" part="layout"><div class="ui5-form-item-label" part="label"><slot name="labelContent"></slot></div><div class="ui5-form-item-content" part="content">${ repeat(this.content, (item, index) => (item as typeof item & {_id?: any})._id || index, (item, index: number) => block1.call(this, context, tags, suffix, item, index)) }</div></div></div>`;}
function block1 (this: FormItem, context: UI5Element, tags: string[], suffix: string | undefined, item: any, index: number) { return html`<div class="ui5-form-item-content-child"><slot name="${ifDefined(item._individualSlot)}"></slot></div>`;}


export default block0;
